import styled from 'styled-components';

const InputWrapper = styled.div`
  display: flex;
  flex-direction: row;
  font-size: 16px;
  height: 40px;
  margin-top: 10px;
`;

const StyledInput = styled.input`
  padding: 0 15px;
  width: 100%;
`;

const SendButton = styled.button`
  width: 100px;
`;

export {
  InputWrapper,
  StyledInput,
  SendButton,
}
